import { useState, useMemo, useRef, useCallback } from 'react';
import { useParams, Link } from 'react-router-dom';
import { useBillData } from '../hooks/useBillData';
import { useBillActions } from '../hooks/useBillActions';
import { calculateDiscount } from '../utils/calculateDiscount';
import { calculateItemizedBill, type Result } from '../utils/itemizedCalculator';
import type { EnhancedResult, Bill } from '../types';

import CalculationResultModal from '../modal/CalculationResultModal';
import PrintableBillSummary from '../components/PrintableBillSummary';
import ParticipantsSection from '../components/Bill/ParticipantsSection';
import ItemsSection from '../components/Bill/ItemsSection';
import AssignmentsSection from '../components/Bill/AssignmentsSection';
import BillSummary from '../components/Bill/BillSummary';
import { motion } from 'framer-motion';
import { CircleDashed } from 'lucide-react';
import { toast } from 'react-toastify';
import jsPDF from 'jspdf';
import autoTable from 'jspdf-autotable';

interface jsPDFWithAutoTable extends jsPDF {
  lastAutoTable: {
    finalY?: number;
  };
}

function BillPage() {
    const { billId } = useParams<{ billId: string }>();
    const { bill, items, participants, loading } = useBillData(billId);
    const actions = useBillActions(billId);
    const [isResultModalOpen, setIsResultModalOpen] = useState(false);
    const [results, setResults] = useState<EnhancedResult[]>([]);
    const printableRef = useRef<HTMLDivElement>(null);

    const totals = useMemo(() => {
        const subtotal = items.reduce((s, i) => s + i.price * i.quantity, 0);
        const discountValue = calculateDiscount(subtotal, bill?.discount || '');
        const tax = subtotal * ((bill?.taxPercent ?? 0) / 100);
        const service = bill?.serviceFee ?? 0;
        return { subtotal, tax, service, discount: discountValue, grandTotal: subtotal + tax + service - discountValue };
    }, [items, bill]);
    
    const handleCalculate = useCallback(() => {
        if (!participants.length || !items.length || !bill) {
          toast.error('Tambahkan minimal satu item & peserta!');
          return;
        }
        const calculatedResults = calculateItemizedBill(participants, items, {
            taxPercent: bill.taxPercent, serviceFee: bill.serviceFee, discount: totals.discount,
        });
        const enhancedResults: EnhancedResult[] = calculatedResults.map((res: Result) => { 
            const p = participants.find(p => p.id === res.id);
            return {
                ...res, id: p?.id || '', name: p?.name || '', isPaid: p?.paid || false,
                items: items.filter(item => (p?.assignments?.[item.id] || 0) > 0).map(item => ({ ...item, quantity: p?.assignments?.[item.id] || 0 })),
            };
        });
        setResults(enhancedResults);
        setIsResultModalOpen(true);
    }, [participants, items, bill, totals]);

    const handleModalDownload = useCallback(async (currentResults: EnhancedResult[], currentBill: Bill | null) => {
        const toastId = toast.loading("Mendesain Invoice Profesional...");
        try {
            const pdf = new jsPDF('p', 'pt', 'a4') as jsPDFWithAutoTable;
            const pageWidth = pdf.internal.pageSize.getWidth();
            const pageMargin = 40;
            
            const primaryColor: [number, number, number] = [16, 185, 129];
            const darkColor: [number, number, number] = [30, 41, 59];
            const lightTextColor: [number, number, number] = [100, 116, 139];
            const borderColor: [number, number, number] = [226, 232, 240];
            const errorColor: [number, number, number] = [220, 38, 38];

            const logoBase64 = 'data:image/png;base64,';

            const formatRupiahPDF = (value: number): string => new Intl.NumberFormat('id-ID', { style: 'currency', currency: 'IDR', minimumFractionDigits: 0 }).format(value);
            const today = new Intl.DateTimeFormat('id-ID', { dateStyle: 'long' }).format(new Date());
            let currentY = 0;

            const drawHeader = () => {
                pdf.setFillColor(darkColor[0], darkColor[1], darkColor[2]);
                pdf.rect(0, 0, pageWidth, 120, 'F');
                if (logoBase64.startsWith('data:image')) {
                  pdf.addImage(logoBase64, 'PNG', pageMargin, 40, 130, 40); 
                }
                pdf.setFontSize(26);
                pdf.setFont('helvetica', 'bold');
                pdf.setTextColor(255, 255, 255);
                pdf.text('INVOICE', pageWidth - pageMargin, 60, { align: 'right' });
                pdf.setFontSize(11);
                pdf.setFont('helvetica', 'normal');
                pdf.setTextColor(200, 200, 200);
                pdf.text(`Tagihan: ${currentBill?.billName || 'Tidak Diketahui'}`, pageWidth - pageMargin, 80, { align: 'right' });
                pdf.text(`Tanggal Cetak: ${today}`, pageWidth - pageMargin, 95, { align: 'right' });
            };

            const drawFooter = (pageNumber: number, pageCount: number) => {
                const footerY = pdf.internal.pageSize.getHeight() - 40;
                pdf.setDrawColor(borderColor[0], borderColor[1], borderColor[2]);
                pdf.line(pageMargin, footerY, pageWidth - pageMargin, footerY);
                pdf.setFontSize(9);
                pdf.setTextColor(lightTextColor[0], lightTextColor[1], lightTextColor[2]);
                pdf.text('Dibuat dengan SplitBill', pageMargin, footerY + 20); 
                pdf.text(`Halaman ${pageNumber} / ${pageCount}`, pageWidth - pageMargin, footerY + 20, { align: 'right' });
            };

            drawHeader();
            currentY = 140; 

            pdf.setDrawColor(borderColor[0], borderColor[1], borderColor[2]);
            pdf.line(pageMargin, 120, pageWidth - pageMargin, 120);
            currentY += 10; 

            currentResults.forEach((result, index) => {
                if (currentY + 150 > pdf.internal.pageSize.getHeight() - 60) {
                    pdf.addPage();
                    drawHeader();
                    currentY = 140; 
                }

                pdf.setFontSize(16);
                pdf.setFont('helvetica', 'bold');
                pdf.setTextColor(darkColor[0], darkColor[1], darkColor[2]);
                pdf.text(`Rincian untuk: ${result.name}`, pageMargin, currentY);
                currentY += 15;

                const tableBody = result.items.map(item => [
                    item.name, `${item.quantity}x`, formatRupiahPDF(item.price), formatRupiahPDF(item.price * item.quantity)
                ]);

                autoTable(pdf, {
                    startY: currentY + 10,
                    head: [['Item', 'Qty', 'Harga Satuan', 'Subtotal']],
                    body: tableBody,
                    theme: 'grid',
                    headStyles: { 
                        fillColor: primaryColor, fontSize: 10, textColor: [255, 255, 255], fontStyle: 'bold'
                    },
                    styles: { 
                        fontSize: 9, cellPadding: 7, lineColor: borderColor, textColor: darkColor
                    },
                    margin: { left: pageMargin, right: pageMargin },
                    didDrawPage: (data) => {
                        drawFooter(data.pageNumber, pdf.getNumberOfPages());
                    }
                });
                currentY = pdf.lastAutoTable.finalY ?? currentY;

                const summaryBody = [
                    ['Subtotal Item:', formatRupiahPDF(result.personalSubtotal)],
                    ['Pajak:', formatRupiahPDF(result.personalTax)],
                    ['Service:', formatRupiahPDF(result.personalService)],
                ];
                if (result.personalDiscount > 0) {
                    summaryBody.push(['Diskon:', `-${formatRupiahPDF(result.personalDiscount)}`]);
                }
                
                autoTable(pdf, {
                    startY: currentY + 10,
                    body: summaryBody,
                    theme: 'plain',
                    margin: { left: pageWidth - pageMargin - 200, right: pageMargin },
                    tableWidth: 200,
                    styles: {
                        fontSize: 10,
                        cellPadding: 3,
                        textColor: darkColor,
                    },
                    columnStyles: {
                        0: { halign: 'left', fontStyle: 'normal' },
                        1: { halign: 'right', fontStyle: 'normal' }
                    },
                    didParseCell: (data) => {
                        if(data.row.section === 'body' && data.cell.text[0].includes('Diskon')) {
                            data.cell.styles.textColor = errorColor;
                        }
                    }
                });
                currentY = pdf.lastAutoTable.finalY ?? currentY;

                pdf.setFillColor(primaryColor[0], primaryColor[1], primaryColor[2]);
                pdf.rect(pageWidth - pageMargin - 200, currentY, 200, 25, 'F');
                
                pdf.setFontSize(11);
                pdf.setFont('helvetica', 'bold');
                pdf.setTextColor(255, 255, 255);
                pdf.text('TOTAL BAYAR:', pageWidth - pageMargin - 195, currentY + 16);
                pdf.text(formatRupiahPDF(result.total), pageWidth - pageMargin - 5, currentY + 16, { align: 'right' });
                currentY += 40;

                if (index < currentResults.length - 1) {
                    pdf.setDrawColor(borderColor[0], borderColor[1], borderColor[2]);
                    pdf.line(pageMargin, currentY - 10, pageWidth - pageMargin, currentY - 10);
                    currentY += 20;
                }
            });
            
            currentY += 50;

            const grandTotal = currentResults.reduce((sum, result) => sum + result.total, 0);
            
            if (currentY + 50 > pdf.internal.pageSize.getHeight() - 60) {
                pdf.addPage();
                drawHeader();
                currentY = 140;
            }

            pdf.setDrawColor(darkColor[0], darkColor[1], darkColor[2]);

            pdf.line(pageWidth - pageMargin - 250, currentY, pageWidth - pageMargin, currentY); 
            currentY += 55;

            pdf.setFontSize(13);
            pdf.setFont('helvetica', 'bold');
            pdf.setTextColor(darkColor[0], darkColor[1], darkColor[2]);
            pdf.text('TOTAL KESELURUHAN:', pageWidth - pageMargin - 250, currentY, { align: 'left' });

            pdf.text(formatRupiahPDF(grandTotal), pageWidth - pageMargin, currentY, { align: 'right' });
            currentY += 50; 

            pdf.line(pageWidth - pageMargin - 250, currentY, pageWidth - pageMargin, currentY);
            currentY += 10;

            drawFooter(pdf.getNumberOfPages(), pdf.getNumberOfPages());
            
            const safeBillName = currentBill?.billName.replace(/[^a-z0-9]/gi, '_').toLowerCase() || 'summary';
            pdf.save(`invoice_${safeBillName}.pdf`);
            
            toast.update(toastId, { render: "Invoice profesional berhasil dibuat!", type: "success", isLoading: false, autoClose: 5000 });
        } catch (error) {
            console.error('Gagal membuat PDF invoice:', error);
            toast.update(toastId, { render: "Gagal membuat invoice. Cek konsol.", type: "error", isLoading: false, autoClose: 5000 });
        }
    }, []);

    if (loading) return (
        <div className="min-h-screen flex items-center justify-center bg-gray-900"><CircleDashed size={64} className="animate-spin text-gray-500" /></div>
    );
    if (!bill) return (
        <div className="min-h-screen flex flex-col items-center justify-center bg-gray-900"><p className="text-xl">Tagihan tidak ditemukan.</p><Link to="/dashboard" className="mt-4 text-emerald-400 hover:underline">Kembali ke Dashboard</Link></div>
    );

    return (
        <>
            <div className="min-h-screen w-full bg-gray-900 font-sans p-4 sm:p-8 flex justify-center items-center">
                <motion.div className="relative max-w-md w-full bg-gray-900 text-gray-300 rounded-lg p-6 sm:p-8" style={{ border: '1px dashed #4B5563', boxShadow: '0 0 40px rgba(0,255,100,0.1)', fontFamily: 'monospace' }} initial={{ opacity: 0, y: -20 }} animate={{ opacity: 1, y: 0 }} transition={{ duration: 0.5 }}>
                    <div className="flex justify-between items-center mb-6">
                        <Link to="/dashboard" className="text-gray-400 hover:text-green-500 transition-colors">&larr; Back</Link>
                        <h1 className="text-2xl font-extrabold text-green-400 text-center flex-grow">{bill.billName}</h1>
                        <p className="text-xs text-gray-500">#{billId?.substring(0, 8)}</p>
                    </div>
                    
                    <ParticipantsSection participants={participants} onAddParticipant={actions.onAddParticipant} onDeleteParticipant={actions.onDeleteParticipant} />
                    <ItemsSection items={items} onAddItem={actions.onAddItem} onDeleteItem={actions.onDeleteItem} />
                    <div className="mb-6 pb-4 border-b border-dashed border-gray-700">
                        <AssignmentsSection
                          items={items}
                          participants={participants}
                          onAssignItem={(pid, iid, change) => actions.onAssignItem(pid, iid, change, participants.find(p => p.id === pid)?.assignments || {})}
                        />
                    </div>
                    <BillSummary bill={bill} totals={totals} items={items} onUpdate={actions.onBillUpdate} onCalculate={handleCalculate} canCalculate={items.length > 0 && participants.length > 0} />
                </motion.div>
            </div>

            <div style={{ position: 'absolute', left: '-9999px' }}><div ref={printableRef}><PrintableBillSummary billName={bill.billName} results={results} /></div></div>
            <CalculationResultModal 
                isOpen={isResultModalOpen} 
                onClose={() => setIsResultModalOpen(false)} 
                results={results} 
                onDownload={() => handleModalDownload(results, bill)}
                onMarkAsPaid={(pid) => actions.onMarkAsPaid(pid, participants)} 
                onCancelPaid={(pid) => actions.onCancelPaid(pid, bill.status)} 
                billName={bill.billName} />
        </>
    );
}

export default BillPage;